import './/App.css';
import Navbar from '../Navbar/Navbar';
import Planner from '../Calendar/Planner';
import React from 'react';
import {BrowserRouter as Router, Route, Routes} from 'react-router-dom';

function App() {
  return (
    <Router>
      <div className="App">
        <Navbar></Navbar>
        <Planner></Planner>
      </div>
    </Router>
  );
}

export default App;
